import React from 'react';

import MailList from './MailList';
// import MailView from './MailView';
import TopBar from './TopBar';
// import NavBar from './Navbar';

import SharedContext from './SharedContext';

/**
 * @return {object} JSX
 */
function Home() {
  const [mailbox, setMailbox] = React.useState('sent');
  const [mailid, setMailid] = React.useState('123');
  return (
    <SharedContext.Provider
      value={{mailbox, setMailbox, mailid, setMailid}}>
      <TopBar />
      <MailList />
    </SharedContext.Provider>
  );
}

export default Home;
